INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`)
VALUES
	('node','page',0,1,1,'und',0,'<p><strong>Who We Are</strong></p><p>We are a grassroots branch of the Queensland Greens based in the western suburbs of Brisbane.</p><p><strong>When We Meet</strong></p><p>The West Brisbane Branch has its regular branch meetings on the first Sunday of each month.</p><p><strong>Mission</strong></p><p>Our four guiding principles are:</p><ul><li>ecological sustainability</li><li>social justice</li><li>grass-roots democracy</li><li>peace and non-violence&nbsp;</li></ul><p><strong>Electorates</strong></p><p>The West Brisbane Greens cover the following electorates:</p><p>Federal divisions - parts of Ryan and Oxley (see the see the Australian Electoral Commission website for information regarding electorate boundaries - http://www.aec.gov.au/).</p><p>State districts - Indooroopilly, Mount Ommaney and Moggill (see the Electoral Commission Queensland website for information regarding electorate boundaries - http://www.ecq.qld.gov.au/).</p><p>Council wards - Walter Taylor, Pullenvale, Jamboree, Tennyson, Richlands (see the Brisbane City Council website for information regarding electorate boundaries - <a href=\"http://www.brisbane.qld.gov.au/\" target=\"_blank\">http://www.brisbane.qld.gov.au/</a>).</p>','','full_html'),
